import React, { useState } from 'react'
import { Link } from 'react-router-dom'

function ResultList(props) {
  function handleClick(repo) {
    props.onResultItemClick(repo)
  }

  return (
      <div className='ResultList'>
        {props.repos.length === 0 && props.preloader && <h1>Loading...</h1>}
        {props.preloader === false && props.repos.length === 0 && <h1>Nothing found</h1>}

        {props.repos.map((repo, index) => {
          return (
            <div key={index} className='ResultItem' onClick={() => {handleClick(repo)}}>
              <Link to={`/card/${index}`}>Card</Link>

              <h1>{repo.name}</h1>
              <p>{repo.stars} звезд </p>
              <p>Последний коммит {repo.lastCommitDate}</p>
              <p>{repo.url}</p>
            </div>
          )
        })}
      </div>
  )
}

export default ResultList
